import { CButton } from "@coreui/react";
import { Row } from "react-bootstrap";
import { FormInput } from "src/Components/UI/Input/FormInput";

const AddOrderItem = () =>{
    return(
        <Row>
             <FormInput
            type="text"
            label="Product Name"
            readOnly={false}
            size={4}
          />
          <FormInput type="number" label="Quantity" readOnly={false} size={2} />
          <Col md={3}>
            <CButton
              color="danger"
              name="ADD MORE"
              click={addMoreToCardHandler}
              type="button"
            />
          </Col>
        </Row>
    );
}
export default AddOrderItem;
